import React, { Component } from "react";

import "./AboutDataStructure.css";

export default class AboutStack extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">The Stack</h3>
        <img
          className="data-image"
          src={require("./../../gifs/stack.gif")}
        ></img>
        <p className="paragraph">
          The stack can be thought of a physical stack of books. As you place
          books on top of each other you can only take off the top item in order
          to remove things from it. This allows us to keep the Last-In First-Out
          ordering and also makes removing and inserting from the stack very
          efficient (constant, since we only need to keep track of the top
          item). Here, push adds an item nd pop removes an item. The peek method
          returns the current top item in the stack. In our case, the red items
          can be thought of each grid cell in the search. The stack is
          implemented in the Depth-First-Search algorithm.
        </p>
        <button
          className="close"
          onClick={() => {
            this.props.close();
          }}
        >
          Close
        </button>
        <a href="https://www.github.com/MilanFatschel" target="_blank">
          The link the implemented stack can be accessed here
        </a>
      </div>
    );
  }
}
